package baekAlgoTest.printN;
import java.util.*;

public class PrintN {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner scn = new Scanner(System.in);
		int input = scn.nextInt();
		
		for ( int i = 0 ; i < input ; i ++){
			System.out.println(i + 1);
		}
			
	}

}
